import React from "react";
import Contact from "./Contact";

function ContactList({ contacts, onDelete, onUpdate }) {
    return (
        <table>
            <thead>
                <tr>
                    <th>First Name</th>
                    <th>Last Name</th>
                    <th>Phone</th>
                    <th>Action</th>
                </tr>
            </thead>
            <tbody>
                {contacts.map((contact) => (
                    <Contact
                        key={contact.id}
                        contact={contact}
                        onDelete={onDelete}
                        onUpdate={onUpdate}
                    />
                ))}
            </tbody>
        </table>
    );
}

export default ContactList;
